import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Icon from '@material-ui/core/Icon';
import { AddIcon, FilterList, MoreVert } from '@material-ui/icons';
import Grid from '@material-ui/core/Grid';
import IconButton from '@material-ui/core/IconButton';
import Chip from '@material-ui/core/Chip';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  button: {
    margin: theme.spacing(1),
  },
}));

const theme = {
  spacing: 8,
}

const SecondaryNav = () => {
  const classes = useStyles();

  const handleDelete = () => {
    console.info('You clicked the delete icon.');
  };

  const handleClick = () => {
    console.info('You clicked the Chip.');
  };

  return(
    <Container maxWidth="lg">
      <Grid
      container
      direction="row"
      justify="space-evenly"
      alignItems="center"
      >
        <Grid xs={12} sm={6}>
          <Box display="flex" flexDirection="row" fontSize="h3.fontSize" my={3} color="#152457">
            Program List
          </Box>
        </Grid>
        <Grid xs={12} sm={6}>
          <Box display="flex" justifyContent="flex-end" my={3}>
            <Button
            variant="contained"
            color="primary"
            className={classes.button}
            endIcon={<Icon>add</Icon>}
          >
            Create New Program
          </Button>
          <IconButton aria-label="listfilter" color="black">
            <FilterList />
          </IconButton>
          <IconButton aria-label="morevert" color="black">
            <MoreVert />
          </IconButton>
          </Box>
        </Grid>
        <Grid xs={12} sm={12}>
          <Box display="flex" justifyContent="flex-end" my={2}>
            <Chip label="Deletable primary" onDelete={handleDelete} color="black" variant="outlined" />
            <Chip label="Deletable primary" margin="0 8xp 0 0" onDelete={handleDelete} color="black" variant="outlined" />
          </Box>
        </Grid>
      </Grid>
    </Container>
  )
}

export default SecondaryNav;
